const BlockType = require('../../extension-support/block-type');
const ArgumentType = require('../../extension-support/argument-type');
const TargetType = require('../../extension-support/target-type');

class Advance {

    constructor (runtime) {
        // put any setup for your extension here
    }

    /**
     * Returns the metadata about your extension.
     */
    getInfo () {
        return {
            id: 'advancescratch',

            // name that will be displayed in the Scratch UI
            name: 'Advance',

            // colours to use for your extension blocks
            color1: '#232323',
            color2: '#282828',

            // icons to display
            menuIconURI: 'data:image/png;base64,',
            blockIconURI: 'data:image/png;base64,',

            // your Scratch blocks
            blocks: [
                {
                    opcode: 'euler',
                    blockType: BlockType.REPORTER,
                    text: 'e',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                },
                {
                    opcode: 'pi',
                    blockType: BlockType.REPORTER,
                    text: 'π',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                },
                {
                    opcode: 'log2e',
                    blockType: BlockType.REPORTER,
                    text: 'log2 of e',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                },
                {
                    opcode: 'log10e',
                    blockType: BlockType.REPORTER,
                    text: 'log10 of e',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                },
                {
                    opcode: 'trunc',
                    blockType: BlockType.REPORTER,
                    text: 'truncate [N]',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                    arguments: {
                        N:{
                            type: ArgumentType.NUMBER
                        }
                    }
                },
                {
                    opcode: 'sign',
                    blockType: BlockType.REPORTER,
                    text: 'sign of [N]',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                    arguments: {
                        N:{
                            type: ArgumentType.NUMBER
                        }
                    }
                },
                {
                    opcode: 'pow',
                    blockType: BlockType.REPORTER,
                    text: '[A] ^ [B]',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                    arguments: {
                        A:{
                            type: ArgumentType.NUMBER
                        },
                        B:{
                            type: ArgumentType.NUMBER
                        }
                    }
                },
                {
                    opcode: 'text',
                    blockType: BlockType.REPORTER,
                    text: 'text [S]',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                    arguments: {
                        S:{
                            type: ArgumentType.STRING
                        }
                    }
                },
                {
                    opcode: 'num',
                    blockType: BlockType.REPORTER,
                    text: 'number [N]',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                    arguments: {
                        N:{
                            type: ArgumentType.NUMBER
                        }
                    }
                },
                {
                    opcode: 'bool',
                    blockType: BlockType.BOOLEAN,
                    text: 'bool [B]',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                    arguments: {
                        B:{
                            menu: 'bool',
                            type: ArgumentType.BOOLEAN
                        }
                    }
                },
                {
                    opcode: 'isbn',
                    blockType: BlockType.REPORTER,
                    text: '[P] of book from ISBN code [C] using Open Library',
                    terminal: false,
                    filter: [ TargetType.SPRITE, TargetType.STAGE ],
                    arguments: {
                        P:{
                            menu: 'isbnp',
                            type: ArgumentType.STRING
                        },
                        C:{
                            type: ArgumentType.NUMBER
                        }
                    }
                }
            ],
            menus:{
                bool:{
                    items:['true','false']
                },
                isbnp:{
                    items:['publishers','title','publish date/year','# of pages']
                }
            }
        };
    }
    euler(){
        return Math.E;
    }
    pi(){
        return Math.PI;
    }
    log2e(){
        return Math.LOG2E;
    }
    log10e(){
        return Math.LOG10E;
    }
    trunc({N}){
        return Math.trunc(N);
    }
    sign({N}){
        return Math.sign(N);
    }
    pow({A,B}){
        return Math.pow(A,B);
    }
    text({S}){
        return S;
    }
    num({N}){
        return N;
    }
    bool({B}){
        if(B=='true'){
            return true
        }
        return false
    }
    isbn({P,C}){
        return fetch('https://openlibrary.org/isbn/'+C+'.json')
            .then((response)=>{
                if(response.ok){
                    return response.json();
                }else{
                    return {title:'unknown',publishers:'unknown',publish_date:'unknown',number_of_pages:'unknown'};
                }
            })
            .then((binfo)=>{
                if(P=='publishers'){
                    return binfo.publishers;
                }
                if(P=='title'){
                    return binfo.title;
                }
                if(P=='publish date/year'){
                    return binfo.publish_date;
                }
                if(P=='# of pages'){
                    return binfo.number_of_pages;
                }
            });
    }
}
module.exports = Advance;
